import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ addToCart, totalItems }) {
  const navigate = useNavigate();

  const buttonStyle = {
    border: "none",
    width: "auto",
    height: "240px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
    background: "none",
    textAlign: "center",
  };

  const imgStyle = {
    width: "120px",
    height: "auto",
    borderRadius: "10px",
    objectFit: "cover",
  };

  const labelStyle = {
    fontFamily: "Sansita Swashed,cursive",
    marginTop: "10px",
    background: "#A17557",
    borderRadius: "5px",
    padding: "5px",
    width: "120px",
    border: "2px solid black",
  };

  return (
    <div style={{ textAlign: "center", position: "relative", minHeight: "100vh" }}>
      {/* Grid container */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(5, 1fr)",
          gridTemplateRows: "repeat(2, auto)",
          gap: "1.5rem",
          maxWidth: "840px",
          margin: "3rem auto 6rem auto",
          padding: "0 0.5rem",
          background: "none",
        }}
      >
        {/* Espresso - col 1, row 1 */}
        <div
          style={{
            gridColumn: "1 / 2",
            gridRow: "1 / 2",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <button onClick={() => navigate("/espresso")} style={buttonStyle}>
            <img src={espressoImg} alt="Espresso" style={imgStyle} />
            <div style={labelStyle}>Espresso</div>
          </button>
        </div>

        {/* Refresher - col 2, row 1 */}
        <div
          style={{
            gridColumn: "2 / 3",
            gridRow: "1 / 2",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <button onClick={() => navigate("/refresher")} style={buttonStyle}>
            <img src={refresherImg} alt="Refresher" style={imgStyle} />
            <div style={labelStyle}>Refresher</div>
          </button>
        </div>

        {/* Tea - col 3, row 1 */}
        <div
          style={{
            gridColumn: "3 / 4",
            gridRow: "1 / 2",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <button onClick={() => navigate("/tea")} style={buttonStyle}>
            <img src={teaImg} alt="Tea" style={imgStyle} />
            <div style={labelStyle}>Tea</div>
          </button>
        </div>

        {/* Pastry - col 4, row 2 */}
        <div
          style={{
            gridColumn: "4 / 5",
            gridRow: "2 / 3",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <button onClick={() => navigate("/pastry")} style={buttonStyle}>
            <img src={pastryImg} alt="Pastry" style={imgStyle} />
            <div style={labelStyle}>Pastry</div>
          </button>
        </div>

        {/* Blended Beverage - col 5, row 2 */}
        <div
          style={{
            gridColumn: "5 / 6",
            gridRow: "2 / 3",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <button onClick={() => navigate("/blended")} style={buttonStyle}>
            <img src={blendedImg} alt="Blended" style={imgStyle} />
            <div style={labelStyle}>Blended Beverage</div>
          </button>
        </div>
      </div>

      {/* Fixed bottom right buttons container */}
      <div
        style={{
          position: "fixed",
          bottom: "20px",
          right: "20px",
          display: "flex",
          gap: "15px",
          alignItems: "center",
          zIndex: 1000,
        }}
      >
        {/* Back Home Button */}
        <button
          onClick={() => navigate("/")}
          style={{
            background: "#eee",
            border: "none",
            borderRadius: "50%",
            width: "60px",
            height: "60px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            cursor: "pointer",
            boxShadow: "0 4px 8px rgba(0,0,0,0.15)",
            transition: "background-color 0.3s ease",
          }}
          aria-label="Back to Home"
          title="Back to Home"
          onMouseEnter={e => e.currentTarget.style.background = "#cbb292"}
          onMouseLeave={e => e.currentTarget.style.background = "#eee"}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="30"
            height="30"
            fill="none"
            stroke="currentColor"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart Icon */}
        <div
          style={{
            background: "#A17557",
            borderRadius: "50%",
            width: "60px",
            height: "60px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            position: "relative",
            cursor: "pointer",
            boxShadow: "0 4px 8px rgba(0,0,0,0.15)",
            transition: "background-color 0.3s ease",
          }}
          onClick={() => navigate("/cart")}
          onMouseEnter={e => (e.currentTarget.style.background = "#cbb292")}
          onMouseLeave={e => (e.currentTarget.style.background = "#A17557")}
          aria-label="Cart"
          title="Cart"
        >
          <CartIcon totalItems={totalItems} />
          {/* Badge */}
          {totalItems > 0 && (
            <span
              style={{
                position: "absolute",
                top: "6px",
                right: "6px",
                background: "red",
                color: "white",
                borderRadius: "50%",
                padding: "2px 7px",
                fontSize: "0.75rem",
                fontWeight: "bold",
                boxShadow: "0 0 3px rgba(0,0,0,0.3)",
              }}
            >
              {totalItems}
            </span>
          )}
        </div>
      </div>
    </div>
  );
}
